def test_create_alert():
    img = Image.open(test_image_file)
    proba = 0.98
    alert = create_alert(img, proba)


    # Create expected results
    face_model = operational_config["models"]["face_detection"]["model"]
    face_threshold = operational_config["models"]["face_detection"]["threshold"]
    mask_model = operational_config["models"]["mask_classifier"]["model"]
    mask_threshold = operational_config["models"]["mask_classifier"]["threshold"]
    mask_model_guid: str = operational_config["models"]["mask_classifier"]["guid"]
    face_model_guid: str = operational_config["models"]["face_detection"]["guid"]
    device: dict = operational_config["device"]
    deployment: dict = operational_config["deployment"]

    expected_alert = alert_pb2.Alert()

    expected_alert.event_time = alert.event_time  # to ensure same time

    expected_alert.created_by.type = device["type"]
    expected_alert.created_by.guid = device["guid"]
    expected_alert.created_by.enrolled_on = device["enrolled_on"]
    expected_alert.location.latitude = deployment["latitude"]
    expected_alert.location.longitude = deployment["longitude"]
    expected_alert.face_detection_model.name = face_model
    expected_alert.face_detection_model.guid = face_model_guid
    expected_alert.face_detection_model.threshold = face_threshold
    expected_alert.mask_classifier_model.name = mask_model
    expected_alert.mask_classifier_model.guid = mask_model_guid
    expected_alert.mask_classifier_model.threshold = mask_threshold
    expected_alert.probability = proba
    expected_alert.image.format = "jpeg"
    expected_alert.image.size.width = img.size[0]
    expected_alert.image.size.height = img.size[1]
    expected_alert.image.data = image_to_byte_array(img)

    assert expected_alert == alert
